import { Meme } from "../Meme/Meme";
import { Switch, Route } from "react-router-dom"
import { MemeGenerated } from "../MemeGenerated/MemeGenerated";
// import styles from "./styles.module.css";

export const App = () => {
  return (
    <Switch>
      <Route path='/'>
        <Meme/>
      </Route>
      <Route path='/generated'>
        <MemeGenerated/>
      </Route>
    </Switch>
  )
};
